import "./App.css";
import "./reset.css";
import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();

  useEffect(() => {
    (async () => {
      const result = await fetch(
        "http://localhost:8000/fx"
        // "https://www.alphavantage.co/query?function=FX_DAILY&from_symbol=USD&to_symbol=JPY&apikey=4THZE2SRL8MOGD1C"
      );
      const json = await result.json();
      console.log({
        train: json.train && JSON.parse(json.train).close,
        close: json.close && JSON.parse(json.close).close,
      });
      // setData({
      //   train: JSON.parse(json.train).close,
      //   close: JSON.parse(json.close).close,
      // });
    })();
  }, []);

  return (
    <div>
      {Object.entries(data?.train || {})?.map(([key, value]) => (
        <div>
          {key} {value}
        </div>
      ))}
      {Object.entries(data?.close || {})?.map(([key, value]) => (
        <div>
          {key} {value}
        </div>
      ))}
    </div>
  );
}

export default App;
